  [],\n\t\"revision_timestamp\": \"2016-05-25T00:43:07.899071\",\n\t\"name\": \"fiscal-management-information-system-4-0-fmis-4-0\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The current FMIS system, which was defined
  in 1999 and implemented in 2002, is based on a mainframe platform that is extremely
  outdated. The current design is at a dead-end client server, and it is difficult
  and costly to find qualified employees to just maintain the current system. An IT
  solution is necessary to ensure compliance with DOT Security Standards (timeout),
  eliminate costly manual programming processes for software commands, improve ease-of-use,
  and enhance oversight and reporting. Using an IT solution, the current system would
  be re-written in a more modern solution (Visual Studio .Net). All of the financial
  systems would be consolidated into one (FMIS, RASPS, and DIMS). The modified system
  would comply with all DOT security standards, address current and future needs,
  and automatically generate software commands.\",\n\t\"license_title\": \"Other License
